function getMousePos(canvas, evt) {
    var rect = canvas.getBoundingClientRect();
    return {
      x: evt.clientX - rect.left,
      y: evt.clientY - rect.top
    };
}

function draw_marker(_graph,_markers_to_channel,_current_vertex = 0)
{
	_markers_to_channel.forEach(function(_marker){
		if (_marker.channel_id != null)
		{
			_graph.getVertexById(_marker.channel_id).color = $("#"+_marker.id).attr("color");
			_graph.getVertexById(_marker.channel_id).stroke_color = $("#"+_marker.id).attr("stroke_color");
		}
	});
	_graph.draw();

	if(_current_vertex != 0)
	{
		var img = new Image();
		w = 734;
		h = 518;
		img.src="play.svg";
		_graph.draw_settings.context.drawImage(img,_current_vertex.coords.x_abs + _current_vertex.size - w/40,_current_vertex.coords.y_abs - h/80,w/40,h/40);
		//_graph.draw_settings.context.drawImage(img,_current_vertex.coords.x_abs + _current_vertex.size - w/40,_current_vertex.coords.y_abs - h/80,w,h);
	}
}

